import React from "react";
import { Link, Outlet,  BrowserRouter, Routes,
  Route, } from "react-router-dom";

import classes from "./Header.module.css";
import HeaderCartButton from "./HeaderCartButton";

const Header = (props) => {
  return (
    <div className={classes.header}>
      <nav>
        <ul>
          <Link to="/">
            <li>Home</li>
          </Link>
          <Link to="./pages/orderPage">
            <li>Order</li>
          </Link>
          <Link to="./pages/menuPage">
            <li>Menu</li>
          </Link>
          <Link to="pages/locationPage">
            <li>Location</li>
          </Link>
        </ul>
      </nav>

      <HeaderCartButton />

<Routes>
<Route path="/pages/orderPage" element={<OrderPage />} />
<Route path="/pages/menuPage" element={<MenuPage />} />
<Route path="/pages/locationPage" element={<LocationPage />} />
</Routes>
 </div>
  );
};

export default Header;
